}

const WhichWaterDoYouDrink = () => {
  return (
    <Carousel autoplay={true}>
      {list.map((element) => (
        <div>
          <h3 className="Carousel">{element.name}</h3>
        </div>
      ))}
    </Carousel>
  );
}

export default WhichWaterDoYouDrink;
